import React from "react";
import VideojuegoLista from "../Videojuego/VideojuegoLista";

const OfertaItem = ({ oferta }) => {
    return(
        <><div className="card-group">
            <VideojuegoLista oferta={oferta} />
        </div></>
    );
};

export default OfertaItem;
